import React from 'react';
import './Form.css';

const Welcome = ({ username, onLogout }) => {
  return (
    <div className="form-container">
      <h1>Hi {username}!</h1>
      <div className="button-group">
        <button onClick={onLogout}>Logout</button>
      </div>
    </div>
  );
};

export default Welcome;
